import React, {Component} from 'react';
import './login.css';
class Login extends Component{
    state = {
        username: "shivam.oe@objectedge.com",
        password: "oe@123",
        inputUsername:"",
        inputPassword:""
    }
    logIn(){
        console.log("user:password: ");
    }

    render(){
        return(
            <div>
                <h2>Login</h2>
                <form>
                    <input type="text" onChange={this.state.inputUsername} value={this.state.inputUsername}/>
                    <input type="password" onChange={this.state.inputPassword} value={this.state.inputPassword}/>
                    <input type="submit" onClick={this.logIn}/>
                </form>
            </div> 
        );
    }
}

export default Login;
